import React, { useState } from "react";
import Navbar from '../Common/Navbar';
import Footer from '../Common/Footer';
import HeaderBar from '../Common/HeaderBar';


const UserPreferences = ({ onSubmit }) => {
  const [preferences, setPreferences] = useState({
    location: "",
    experience: "",
    speciality: "",
    consultationFee: "",
    availabilityStatus: ""
  });

  const handleChange = (e) => {
    setPreferences({ ...preferences, [e.target.name]: e.target.value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    onSubmit(preferences);
  };

  return (
    <div>
        <HeaderBar />
        <Navbar/>
    <div className="p-6 max-w-md mx-auto bg-white rounded-xl shadow-md">
      <h2 className="text-xl font-bold mb-4">Select Your Preferences</h2>
      <form onSubmit={handleSubmit}>
        {/* Location Dropdown */}
        <label className="block mb-2">Location:</label>
        <select name="location" value={preferences.location} onChange={handleChange} className="w-full p-2 border rounded mb-4">
          <option value="">Select Location</option>
          <option value="pen">Pen</option>
          <option value="kharghar">Kharghar</option>
          <option value="panvel">Panvel</option>
          <option value="chicago">Chicago</option>
        </select>

        {/* Experience Input */}
        <label className="block mb-2">Experience (Years):</label>
        <input type="number" name="experience" value={preferences.experience} onChange={handleChange} className="w-full p-2 border rounded mb-4" />

        {/* Speciality Dropdown */}
        <label className="block mb-2">Speciality:</label>
        <select name="speciality" value={preferences.speciality} onChange={handleChange} className="w-full p-2 border rounded mb-4">
          <option value="">Select Speciality</option>
          <option value="heart">Heart</option>
          <option value="neurologist">Neurologist</option>
          <option value="dermatologist">Dermatologist</option>
        </select>

        {/* Consultation Fee Range */}
        <label className="block mb-2">Consultation Fee:</label>
        <input type="range" name="consultationFee" min="0" max="5000" value={preferences.consultationFee} onChange={handleChange} className="w-full mb-4" />
        <span className="block text-center">{preferences.consultationFee} INR</span>

        {/* Availability Status Dropdown */}
        <label className="block mb-2">Availability Status:</label>
        <select name="availabilityStatus" value={preferences.availabilityStatus} onChange={handleChange} className="w-full p-2 border rounded mb-4">
          <option value="">Select Availability</option>
          <option value="9_to_12">9 AM - 12 PM</option>
          <option value="2_to_5">2 PM - 5 PM</option>
          <option value="6_to_9">6 PM - 9 PM</option>
        </select>

        {/* Submit Button */}
        <button type="submit" className="w-full bg-blue-500 text-white p-2 rounded">Find Doctors</button>
      </form>
    </div>
    <Footer/>
    </div>
  );
};

export default UserPreferences;
